description:
A collection os 5 chess books including 2 requests, converted from DJVU to PDF:

1. Bobby Fischer Teaches Chess by Bobby Fischer and Stuart Margulies
2. French Defence - 3 Nd2 by Lev Psakhis
3. French Defence - Steinitz, Classical &amp; Other systems by Lev Psakhis
4. Weapons of Chess - An Omnibus of Chess Strategies by Bruce Pandolfini
5. 101 Chess Opening Surprises (Gambit chess) by Graham Burgess
